    const [pokemon, setPokemon] = useState([]);

    useEffect(() => {
        api
          .get("")
          .then((response) => setPokemon(response.data.nome))
          .catch((err) => {
            console.error("ops! ocorreu um erro" + err);
          });
      }, []);



